import React from 'react';
import {useQuery} from "react-query";
import {Autocomplete, TextField} from "@mui/material";
import {getBeneficiaries} from "../../ApiService/beneficiaries.api";

const InputBeneficiariesFilter = (props: any) => {
    const [beneficiaries, setBeneficiaries] = React.useState([] as any)
    // API get ALL Users
    useQuery({
        queryKey: ["getBeneficiaries",props.type],
        queryFn: () => getBeneficiaries({params:{skip_page: 1,type: props?.type}}),
        onSuccess: (data) => {
            setBeneficiaries(data.data);
        }
    })
    const handleOnChange = (event: any, values: any) => {
        props.onChange(values);
    }
    return (
        <Autocomplete
            multiple={props.multiple}
            id="combo-box-contract-type"
            options={beneficiaries}
            getOptionLabel={(option) => option.name}
            onChange={handleOnChange}
            size={props.size || "small"}
            renderInput={(params) => <TextField {...params} label={props.title} />}
        />
    );
};

export default InputBeneficiariesFilter;
